package data.victor.com;import java.io.Serializable;/** * Created by victor on 2015/12/25. */public class Channel implements Serializable{    private String name;    private String icon;    private String epg;    private String[] playUrls;    public void setName(String name) {        this.name = name;    }    public void setIcon(String icon) {        this.icon = icon;    }    public void setEpg(String epg) {        this.epg = epg;    }    public void setPlayUrls(String[] playUrls) {        this.playUrls = playUrls;    }    public String getName() {        return name;    }    public String getIcon() {        return icon;    }    public String getEpg() {        return epg;    }    public String[] getPlayUrls() {        return playUrls;    }}